 ('1', '11', 'en_us', '<p>I am a freelance Journalist living in the creative hub that is Austin, TX. I like to research things that me keep up thinking at night so I can create interesting articles for you to read!</p>\n<p>I have two dogs, that inspire me to embrace nature, (and will whine until I take them on long walks outside.)</p>\n<p>I am a Mass Communications major at Texas State University, with a concentration in Journalism.</p>\n<p>I was born in Kerala, India and I am fluent in Malayalam, my first language.</p>\n<p>I was raised in Queens, NY</p>\n<p>I will never turn down a good cup of coffee</p>', 'Hi, My name is Tinu', '2017-01-22 17:24:39', '2017-01-23 20:12:00', '4fee7a50-4820-4f6e-871b-deddec3526a6');



